import React from "react";
import { NavLink } from "react-router-dom";
const Navbar = () => {
  return (
    <>
      <div className="container-fluid">
        <div className="row">
          <div className="col-md-4">
            <h1>Heu</h1>
          </div>
          <div className="col-md-8">
            <div className="nav-right">
              <h2>CHeck</h2>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Navbar;
